/** styles */
import responsive from "@styles/responsive.module.scss";
import space from "@styles/space.module.scss";

/** components */
import { Layout } from "@layout";
import { Card } from "@card/card.component";

/**
 * Renders the priority section
 * @param {string[]} priorities - The priorities
 */
export const HowTemplate: React.FC<{}> = () => {
  const types = ["requirements", "decide", "requirements", "decide"];
  return (
    <Layout variant="homes" title="How hosting works">
      <div className={[space["m-t--16"]].join(" ")}>
        <div
          style={{
            width: "100%",
            gridTemplateColumns: "repeat(4, 1fr)",
          }}
          className={[responsive["b_to_g--sm"]].join(" ")}
        >
          {types.map((type, index) => {
            return (
              <div key={index} className={[space["m-b--64"]].join(" ")}>
                <Card variant="hosting" type={type} />
              </div>
            );
          })}
        </div>
      </div>
    </Layout>
  );
};
